import React from "react";
import { Line } from "react-chartjs-2";

function LineCharts(props) {

    const{xArr, yArr} = props;

  return (
    <Line
      data={{
        labels: xArr,
        datasets: [
          {
            label: "# of votes",
            data: yArr,
            borderWidth: 1,
          },
          // {
          //   label: 'Quantity',
          //   data: [47, 52, 67, 58, 9, 50],
          //   backgroundColor: 'orange',
          //   borderColor: 'red',
          // },
        ],
      }}
      height={400}
      width={600}
      options={{
        maintainAspectRatio: false,
        scales: {
          yAxes: [
            {
              ticks: {
                beginAtZero: true,
              },
            },
          ],
        },
        legend: {
          labels: {
            fontSize: 25,
          },
        },
      }}
    />
  );
}

export default LineCharts;
